import styled from "styled-components";
import { DARK_GRAY } from "../../../public/color";

export const Title = styled.h1`
  font-size: ${(props) => props.style.size};
  font-weight: ${(props) => props.style.weight};
  color: ${(props) => props.style.type};
  margin-bottom: ${(props) => props.style.marginBottom} & > span {
    color: ${DARK_GRAY};
  }
`;
